//index.js
//获取应用实例
const app = getApp()

Page({
  data: {
    userInfo: {},
    statusBarHeight: parseInt(app.globalData.statusBarHeight),
    hasUserInfo: false,
    canIUse: wx.canIUse('button.open-type.getUserInfo'),
    show: "",
    
    imgUrls: [
      'data:image/jpg;base64,',
      'data:image/jpg;base64,',
      'data:image/jpg;base64,'
    ],
    indicatorDots: true,
    previousMargin: '0',
    nextMargin: '0',
    autoplay: false,
    interval: 5000,
    duration: 1000

  },
  //事件处理函数
  bindViewTap: function () {
    wx.navigateTo({
      url: '../logs/logs'
    })
  },
  onLoad: function () {},
  getUserInfo: function (e) {
    console.log(e)
    app.globalData.userInfo = e.detail.userInfo
    this.setData({
      userInfo: e.detail.userInfo,
      hasUserInfo: true
    })
  },
  clickScan: function () {
    wx.navigateTo({
      url: '/pages/auth/index'
    });
  },
  goAuth: function () {
    wx.navigateTo({
      url: '/pages/auth/index'
    });
  },
  goMenu: function (e) {

    const menuname = e.currentTarget.dataset.menuname;
    if (menuname == 'device') {
      wx.navigateTo({
        url: '/pages/index/device/index'
      });
    } else if (menuname == 'task') {
      wx.navigateTo({
        url: '/pages/index/taskmanage/index'
      });
    } else if (menuname == 'appointment') {

      wx.navigateTo({
        url: '/pages/index/appointment/index'
      });

    } else if (menuname == 'patrol') {

      wx.navigateTo({
        url: '/pages/index/patrol/index'
      });

    } else if (menuname == 'energy') {
      wx.navigateTo({
        url: '/pages/index/energy/index'
      });
    }

  },
  onPullDownRefresh: function () {
    //   //调用刷新时将执行的方法
    // app.onRefresh();
    wx.showLoading({
      title: '刷新中',
    })
    app.getsocket(app.globalData.currentId).then(function(res) {
      if (res) {
      // wx.hideLoading()
      }
    })
  }

})